import styled from 'styled-components/native';


export const UploadButton = styled.TouchableOpacity`
    margin-top: 20%;
    background-color: #cfcfcf;
    width: 165px;
    osition: absolute;
    height: 165px;
    border-radius: 98px;
`;

export const UploadText = styled.Text`
    font-size: 55px;
    position: absolute;
    color: #e52246;
    opacity: 0.5;
    z-index: 99;

`

export const Avatar = styled.Image`
    width: 160px;
    height: 160px;
    border-radius: 80px;
`
